        Amanda + Ericjuly 16th, 2022 | arroyo grande, caPlanesSan Luis Obispo County Regional Airport (SBP)~15 minutes to Arroyo GrandeSanta Barbara Airport (SBA)~1 hour and 15 minutes to Arroyo GrandeLos Angeles Airport (LAX)~3 hours to Arroyo GrandeBurbank (BUR)~3 hours to Arroyo GrandeSan Jose (MRY)~3 hour and 15 minutes to Arroyo GrandeMonterey (MRY)~4 minutes to Arroyo Grande via Big Sur/Highway 1
