          <iframe class="responsive-iframe" src="https://www.google.com/maps/d/embed?mid=13KuUCKDzRegHkicMqn5wTJIj_JNX_3U-"></iframe>
        </div>
      </div>
    </main>
  );
};

export default Travel;
